oxy_webhelp_navlinks = {"tasks-d6088e4336":{"topics":[{"title":"Task types","shortdesc":"<p class=\"shortdesc\">Task types were defined to ease understanding their business nature. From the         business point of view we may divide all possible tasks into separate domains: Functional         Tasks and Product tasks. Tasks are divided into types within each domain and may be divided         into subtypes.<\/p>","href":"topics\/untitled10.html","attributes":{"data-id":"untitled10"},"menu":{"hasChildren":false},"tocID":"untitled10-d6088e4347","topics":[]},{"title":"Product tasks","shortdesc":"<p class=\"shortdesc\">Product Tasks are tasks which Finshape handle to design, produce, sale, deliver and         putting its products to use. Product domain tasks are divided into types. Product task types         are associated with enterprise processes. Each task type may have subtypes. <\/p>","href":"topics\/product_tasks.html","attributes":{"data-id":"product_tasks"},"menu":{"hasChildren":true},"tocID":"product_tasks-d6088e4358","next":"product_tasks-d6088e4358"},{"title":"Functional tasks","shortdesc":"<p class=\"shortdesc\">Functional Tasks domain comprises all banking tasks which bank employees and their         clients handle using DBOS. Moreover this domain comprises all tasks that are need to be done         to install and maintenance DBOS and front-end applications. Functional domain tasks are         divided into seven types, each task type may have subtypes. Example, Functional         tasks\/Business tasks\/Payment tasks\/...<\/p>","href":"topics\/functional_tasks.html","attributes":{"data-id":"functional_tasks"},"menu":{"hasChildren":true},"tocID":"functional_tasks-d6088e4487","next":"functional_tasks-d6088e4487"}]}};